import React from 'react';
// import 'materialize-css';
import 'materialize-css/dist/css/materialize.min.css'

import Resource from '../Room/Resource';
// import "../Header/header.scss"
import ResourceList from "../Room/ResourceList";
import ResumeDoc from "../Room/Docs/ResumeDoc.jsx";
import BachelorsDoc from "../Room/Docs/BachelorsDoc.jsx";
import MastersDoc from "../Room/Docs/MastersDoc.jsx";
import GACertDoc from "../Room/Docs/GACertDoc.jsx";
// {ResumeDoc}
//             {MastersDoc}
//             {BachelorsDoc}
//             {GACertDoc}

{/* <div class="button"><img src="/UploadPhotosToWeb/lizkane-1.png" alt="Liz Kane" id="lizkane"></div>  */}

{/* <h3 onClick={<ResumeDoc/>} className="Resume"><ResumeDoc/></h3>
<h3 onClick={openResource} className="Projects">Projects</h3>

<h3 onClick={openResource} className="Education">Education</h3> */}
const Header = () => {

    const openResource = (e) => {
        <ResourceList/>
    }

    return (
        <header>
            {/* <div id="sidebar"> */}
                <nav>
                    <ul className="collapsible">
                        {/* <li className="nameButton">LIZ KANE</li>   */}
                        <li>
                            <div className="collapsible-header nameButton">
                                <i className="material-icons">filter_drama</i>
                                LIZ KANE
                                {/* <span className="new badge" >4</span> */}
                                </div>
                            <div className="collapsible-body"><p>Lorem ipsum dolor sit amet.</p></div>
                        </li>
                        <li>
                            <div className="collapsible-header">
                                <i className="material-icons">filter_drama</i>
                                <ResumeDoc/>
                                <span className="new badge">4</span></div>
                            <div className="collapsible-body"><p>Lorem ipsum dolor sit amet.</p></div>
                        </li>
                        <li>
                            <div className="collapsible-header">
                                <i className="material-icons">place</i>
                                Projects
                                <ul>
                                    <li>
                                        <div className="collapsible-header">
                                            <i className="material-icons">place</i>
                                            Projects
                                            {/* <span className="badge">1</span> */}

                                            </div>
                                        <div className="collapsible-body"><p>Lorem ipsum dolor sit amet.</p></div>
                                    </li>
                                </ul>

                                </div>
                            <div className="collapsible-body"><p>Lorem ipsum dolor sit amet.</p></div>
                        </li>
                        <li>
                            <div className="collapsible-header">
                                <i className="material-icons">place</i>
                                Education
                                <span className="badge">1</span></div>
                            <div className="collapsible-body"><p>Lorem ipsum dolor sit amet.</p></div>
                        </li>
                        <li>
                            <div className="collapsible-header WorkExperience">
                                <i className="material-icons">place</i>
                                Work Experience
                                <span className="badge">1</span></div>
                            <div className="collapsible-body"><p>Lorem ipsum dolor sit amet.</p></div>
                        </li>
                        <li>
                            <div className="collapsible-header Interests">
                                <i className="material-icons">place</i>
                                Interest
                                <span className="badge">1</span></div>
                            <div className="collapsible-body"><p>Lorem ipsum dolor sit amet.</p></div>
                        </li>
                        <li>
                            <div className="collapsible-header About">
                                <i className="material-icons">place</i>
                                About
                                <span className="badge">1</span></div>
                            <div className="collapsible-body"><p>Lorem ipsum dolor sit amet.</p></div>
                        </li>
                        </ul>

                    {/* <h3 onClick={openResource} className="WorkExperience">WorkExperience</h3>
                    <h3 onClick={openResource} className="Interests">Interests</h3>
                    <h3 onClick={openResource} className="About">About</h3> */}
                </nav>
            {/* </div> */}
        </header>
    );
}

export default Header;
